import SearchBar from './components/search/SearchBar'


const App = () => {
  return (
    <Container maxWidth='sm' sx={{bgcolor:"gray"}} >

      <SearchBar />
      <Box sx={{bgcolor:"green", textAlign:"left"}}>
        <Typography>This is Weather Forcast </Typography>
      </Box>
      <Typography variant='h3' >Weather Forcast</Typography>
    </Container>


  )
}

export default App
